using namespace DT::PAR;

std::complex<double> DT::A1A1ZZTree(const double &cos_t, const double &s)
{
    std::complex<double> MHSqcomp = std::complex<double>(MH*MH,-MH*WH);
    std::complex<double> MS1Sqcomp = std::complex<double>(MS1*MS1,-MS1*WS1);

    return -0.125*((MHSqcomp - MS1Sqcomp)*s*token14*token16*token2*token25*(-4.*s* (MZ*MZ) + 12.* (MZ*MZ*MZ*MZ) +  (s*s)))/((MHSqcomp - s)*(-MS1Sqcomp + s)*token28* (cw*cw)* (MZ*MZ*MZ*MZ)* (sw*sw));
}

// Conjugate of the tree-level amplitude without polarization sum factors
std::complex<double> DT::A1A1ZZTreeConj(const double &cos_t, const double &s)
{
    std::complex<double> MHSqcomp = std::complex<double>(MH*MH,-MH*WH);
    std::complex<double> MS1Sqcomp = std::complex<double>(MS1*MS1,-MS1*WS1);

    return std::conj(-0.5*((MHSqcomp - MS1Sqcomp)*s*token14*token16*token2*token25)/((MHSqcomp - s)*(-MS1Sqcomp + s)*token28* (cw*cw)* (sw*sw)));
}

