    // std::cout << std::endl << "full amp: \t" << 0.5*(A1A1ZZTreeConj(cos_t,s)*(A1A1ZZTree(cos_t,s) + 2.*(A1A1ZZ1Loop(cos_t, s) + A1A1ZZCT(cos_t, s)))) << std::endl;
    
